import React from "react";

export default function Modal({ setIsOpen }) {
  return (
    <>
      <div className="modal-bg" onClick={() => setIsOpen(false)} />
      <div className="modal">
        <div className="modal-header"></div>
        <div className="modal-body"></div>
        <div className="modal-footer"></div>
      </div>
    </>
  );
}
